# 验证码图片形式主要有两种 一种是链接形式的图片，直接转化成二进制数据即可，另一种是字符串形式的数据，利用base64模块解码
import base64

img_str = ''

""" 把字符串形式的图片转化成二进制"""
bytes_img = base64.b64decode(img_str)
print(bytes_img)
with open('../../../../yzm.png', mode='wb') as f:
    f.write(bytes_img)

